import React from "react";
import authorization from "./components/Authorization";
export default function Login(){
    const auth = authorization;
return (
<div>
    <h1>Login</h1>
<form>
    <input onChange={auth.updateLogin} value={auth.login.email} type="email" name="email" />
    <input onChange={auth.updateLogin} value={auth.login.password} type="password" name="password" />
    <button type="submit">Login</button>
</form>
</div>
);

}
